window.bookSummaryJSON = "<p>He told me I was his muse. He lied. </p> <p>Anton Sachov, the artist, the man who only sees in monochrome. He wants something from me. </p> <p>Something precious; the meadow green of my eyes, the rich mahogany of my hair, the creamy white of my skin, the stark red of my blood, even the darkness of my soul. And he will do anything to get them. </p> <p>Including the unthinkable, locking me away. </p> <p>Contains mature themes.</p>"; 
